   };
   search('The Rolling stones', opts, function(err, results) {
    if(err) return console.log(err);
    console.dir(results);
  });


class TodoForma1 extends Component{
    constructor(props){
       super(props);
       const dato=this.props.cosas.match.params
       //console.log(props)
       //console.log(dato)
        this.state={
            prioridad1: props.valor1,
            prioridad2: dato.id
        }


        //let messages = await Chat.find({}).limit(8).sort('-created');           
    };  

    render(){
         return(
            <div className="col-md-2">
              <h1>soy compo1 valor={this.state.prioridad1}</h1>
              <h1>dato URL={this.state.prioridad2}</h1>

                    <div className="col-sm-8">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Bajo Construccion</h5>
                            <p className="card-text">wow</p>

                        <select
                            name="priority"
                            className="form-control"
                            value={this.state.priority}
                            onChange={this.handleInputChangeM}
                        >
                            <option>cobre</option>
                            <option>dolar</option>
                            <option>euro</option>
                            <option>ipc</option>
                            <option>ivp</option>
                            <option>oro</option>
                            <option>plata</option>
                            <option>uf</option>
                            <option>utm</option>
                            <option>yen</option>      
                        </select>

                        <div className="card-body" className="col-sm-2">
                        <button className="badge badge-pill badge-dander ml-2" type="submit">Acciones</button>
                                <span className="badge badge-pill badge-dander ml-12">Nombre</span>
                                <button className="btn btn-primary">{esto.name}</button>
                                <span className="badge badge-pill badge-dander ml-12">Unidad</span>
                                <button className="btn btn-primary">{esto.unit}</button>
                                <span className="badge badge-pill badge-dander ml-12">fecha</span>
                                <button className="btn btn-primary">{esto.date}</button>
                                <span className="badge badge-pill badge-dander ml-12">valor</span>
                                <button className="btn btn-primary">{esto.value}</button>
                        </div>


                        </div>
                        </div>
                    </div>
              
            </div>            
        )
    }

}
export default TodoForma1;
